    def __init__(self):
        self.history=[]

    def calculate(self,op,a,b):
        if op=='add':
            result=add(a,b)
        elif op=='subtract':
            result=subtract(a,b)
        elif op=='multiply':
            result=multiply(a,b)
        elif op=='divide':
            result=divide(a,b)
        else:
